webpackJsonp([0x9aa8b0f62b2c],{4942:function(e,o){e.exports={data:{markdownRemark:{html:'<h1>jQuery Hover Method</h1>\n<p>The jquery hover method is a combination of the <code>mouseenter</code> and <code>mouseleave</code> events.\nThe syntax is this:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>$(selector).hover(inFunction, outFunction);</code></pre>\n      </div>\n<p>The first function, inFunction, will run when the <code>mouseenter</code> event occurs.\nThe second function is optional, but will run when the <code>mouseleave</code> event occurs.\nIf only one function is specified, the other function will run for both the <code>mouseenter</code> and <code>mouseleave</code> events.</p>\n<h3>More Information</h3>\n<p>More information can be found <a href="https://www.w3schools.com/jquery/event_hover.asp">here</a>.</p>',fields:{slug:"/jquery/jquery-hover-method/"},frontmatter:{title:"jQuery Hover Method"}}},pathContext:{slug:"/jquery/jquery-hover-method/"}}}});
